(13147, 9295, 1430, 4, 'God Loves Everyone', '', '2002-10-08 00:00:00', 0000, 20, 0, 6, '', 'God loves everyone\nLike a mother loves her son\nNo strings at all\nUnconditional\nNever one to judge\nWould never hold a grudge\n''Bout what''s been done\nGod loves everyone\n\nThere are no gates in heaven\nEveryone gets in\nQueer or straight\nSouls of every faith\nHell is in our minds\nHell is in this life\nBut when it''s gone\nGod takes everyone\n\nIts love is like a womb\nIt’s like the air from room to room\nIt surrounds us all\nThe living and the dead\nMay we never lose the thread\nThat bound us all\n\nThe killer in his cell\nThe atheist as well\nThe pure of heart\nAnd the wild at heart\nAre all worthy of its grace\nIt''s written in the face\nOf everyone\nGod loves everyone\n\nThere''s no need to be saved\nNo need to be afraid\nCause when it’s done\nGod takes everyone\n\nGod loves everyone', 188, '', '', '', '', '', '', 0, 1, 0, '2009-01-17 21:47:26', '2015-03-12 13:37:10', '0000-00-00 00:00:00'),
