(13169, 9296, 1432, 2, 'Why Waste More Time', '', '2006-12-12 00:00:00', 0000, 20, 0, 6, '', 'Why waste your time?\nThere is nothing left\nVoices in your head tell you to do it\nNo one will care\nNo one will know\nEveryone just looks out for themselves\n\nIt''s so hard letting go\nLetting go of love\nIt might cause some pain, I know\nBut pain is all we''ve got\n\nWhy waste more time?\nTime is all you have\nBe careful what you say they''ll hold you to it\nNo one will care\nNo one will know\nEveryone feels sorry for themselves\n\nIt''s so hard letting go\nLetting go of love\nIt might cause some pain, I know\nBut pain is all you''ve got\nIt may be the only way to know\nThat you can get yourself back up', 227, '', '', '', '', '', '', 0, 1, 0, '2009-01-17 21:50:34', '2015-03-12 13:37:10', '0000-00-00 00:00:00'),
