(13177, 9296, 1432, 10, 'These Friends Of Mine', '', '2006-12-12 00:00:00', 0000, 20, 0, 6, '', 'These friends of mine\nLive their lives\nSpend their time\nHoping to find\nWho they are\nHow they''re made\nMaybe they''d\nHelp to find the way\n\nThese friends of mine\nThey have lives\nThey work hard\nTo live them right\nAnd when they laugh\nIt makes me high\nThey''d take a train\nTen thousand miles \nBefore they''d fly\n\nThese friends of mine\nThey feel alone\nWhen the shows are over\nDon''t know where to go\nIn Philadelphia\nAt Christmas time\nThey question love\nWonder why they try\n\nAnd when the show is over\nHow I hope that they discover\nThe joy that they bring\nAnd I hope they remember\nThis bond we have together\nAnd how they love to sing\n\nThese friends of mine\nLive in New York\nThey were raised \nIn Michigan\nThey don''t know things\nThey don''t hold hands\nGuard their hearts\nThe best they can\n\nAnd when the show is over\nHow I hope that they discover\nThe joy that they bring\nAnd I hope they remember\nThis bond we have together\nHow they love to sing\nThey sure love to sing\n\nMaybe I needed this time\nTo be reminded for myself\nMaybe I needed this time\nTo be reminded for myself\nHow I love to sing\n', 306, '', '', '', '', '', '', 0, 1, 0, '2009-01-17 21:51:40', '2015-03-12 13:37:11', '0000-00-00 00:00:00'),
